const Footer = () => {
    return (
        <footer>
            <nav class="navbar bg-dark shadow-lg">
            <i class="bi bi-instagram text-light"></i>
                <div class="container-fluid">
                    <span id='span1' class="navbar-text text-light">
                        Designed by Abduvakhob | Copiright 2023 
                    </span>
                    
                </div>
            </nav>
        </footer>

    )
}




export default Footer;
